const Trade = props => {
  const { trade } = props;


  /*
        buyDate,
      sellDate,
      buyPrice: myBag["buy-price"],
      sellPrice,
      numShares,
      profitPercent: +percentChange-1,
      profitUSD,
      candleLength,
      indicatorAtSell: curIndicatorValue,
      indicatorAtBuy: myBag["indicator-at-buy"]

      */
  return (
    <div className='row'>
      <div className='card w-25 text-danger'>
        Purchase date: {trade.buyDate}
        Sell date:{trade.sellDate}
      </div>
      <div className='card w-50 text-info'>
        woooo
      </div>
    </div>
  )
}

export default Trade;
